import 'package:flutter/material.dart';

void main() {
  runApp(const MainApp());
}

class MainApp extends StatelessWidget {
  const MainApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
     home: CricPlayer(),
    );
    
  }
}
class CricPlayer extends StatefulWidget{
    const CricPlayer({super.key});

    @override
    State createState() => _CricPlayerState();
}
class _CricPlayerState extends State{
int counter = 0;

List<String> playerList = ["data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",];
  List<String> playerNames = [
    "Movie 1: SHAITAAN",
    "Movie 2: VEDAA",
    "Movie 3: PUSHPA 2",
    "Movie 4: BADE MIYAN CHOTE MIYAN",
   
  ];

 

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Movie App"),
        centerTitle: true,
        backgroundColor: Colors.blue,
      ),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: <Widget>[
            Image.network(
              playerList[counter],
              height: 400,
            ),
            const SizedBox(
              height: 10,
            ),
            Text(
              playerNames[counter], // Display corresponding player name
              style: const TextStyle(
                fontSize: 20,
                fontWeight: FontWeight.w300,
              ),
            ),
          ],
        ),
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: () {
          setState(() {
            if (counter < playerList.length - 1) {
              counter++;
            } else {
              counter = 0;
            }
          });
        },
        tooltip: 'Next Player',
        child: const Icon(
          Icons.add,
        ),
      ),
    );
  }
}